window.bookSummaryJSON = "This witch cozy mystery set features nine books in the Witches of Enchanted Bay series including:<br>1. Witches of Enchanted Bay<br>2. Ax To Grind<br>3. Killer Twist<br>4. A Bewitching Murder<br>5. The Nuts and Bolts of Murder<br>6. A Riddle of a Murder<br>7. Strangling Ambition<br>8. Therapy Can Be Murder<br>9. Sick of Murder<br><br>Meg Walton hopes her days of sleuthing are behind her.<br>So when another murder occurs, the secret witch turned sleuth finds her life turned upside down.<br>This time, the case is personal when Meg finds out one of her dearest friends is the victim.<br>Even more, Meg's friend has made enemies of the most influential family in town.<br>Somehow, Meg has to find a way to navigate her grief while cracking her hardest case yet.<br>Is Meg finally in over her head?<br>Find out by buying this set right now!"; 
